import React from 'react'

function TeamMember(props){
    return(
        <div className='col-md-4 col-sm-border'> 
            <div className='card'>
                <div className='card-header'>
                    <img src = {props.img}/>
                    <div className='card-body'>
                        <h1> {props.name} </h1>
                    </div>
                </div>

            </div>
        </div>

    )
}
export default TeamMember;
